import { Row, Col } from "react-bootstrap";

import { BiChevronLeft } from "react-icons/bi";
import briefcaseIcon from "../../Assests/Images/icon/briefcase.svg";


import Heading from "../Heading";

function EmployerDashboard({ setshowSubContentClick }) {

    // let jobTypeBG;
    // switch (jobType) {
    //   case "Contract":
    //     jobTypeBG = "bg-contract";
    //     break;
    //   case "Internship":
    //     jobTypeBG = "bg-internship";
    //     break;
    //   case "Part Time":
    //     jobTypeBG = "bg-partTime";
    //     break;
    //   default:
    //     jobTypeBG = "bg-fullTime";
    // }



  return (
    <div>
      <h1
        onClick={() => setshowSubContentClick(0)}
        className="me-2 d-block d-sm-none"
      >
        <BiChevronLeft className="d-inline" />
        <Heading content="My Profile" design="h1 d-inline-block" />
      </h1>

      <Col lg={10} md={12} sm={12} className="mx-auto my-3">
      <Row className="m-1 text-center text-light">
          <Col className="border border-0 rounded bg-warning mx-1 p-2">
              <h3>15</h3>
              <h6><span class="d-none d-sm-block">Application</span> Pending</h6>
          </Col>
          <Col className="border border-0 rounded bg-primary mx-1 p-2">
              <h3>15</h3>
              <h6><span class="d-none d-sm-block">Application</span> Shortlisted</h6>
          </Col>
          <Col className="border border-0 rounded bg-danger mx-1 p-2">
              <h3>15</h3>
              <h6><span class="d-none d-sm-block">Application</span> Rejected</h6>
          </Col>
          <Col className="border border-0 rounded bg-success mx-1 p-2">
              <h3>15</h3>
              <h6><span class="d-none d-sm-block">Application</span> Hired</h6>
          </Col>
          </Row>
      </Col>

      <Col lg={10} md={12} sm={12} className="mx-auto my-3 border rounded p-2">
          <Heading content="Latest Application" design="h5 border-bottom" />

          <Row>
            <Col lg={10} md={10} sm={12} className="fs-6">
                <p className="mb-0 text-truncate fw-bold">Internship for Web Development</p>
                <p className="mb-0 text-truncate"><a href="/mm" className="text-decoration-none">Samiksha Moghan</a> </p>
                <p className="mb-0 text-truncate">
                    <span
                      className={`badge rounded-pill text-dark bg-fullTime`}
                    >
                      <img
                        alt="dg"
                        className="icon"
                        src={briefcaseIcon}
                      />
                      Full Time
                    </span>
                  </p>
            </Col>
            <Col lg={2} md={2} sm={12}>bd</Col>
          </Row>
      </Col>

      <Col lg={10} md={12} sm={12} className="mx-auto my-3 border">
          evfwsedr
      </Col>
    </div>
  );
}

export default EmployerDashboard;
